import React, { Component } from 'react';
import { Form } from 'react-bootstrap';
import Button from 'react-bootstrap/Button';

class Login extends Component {

    handleButtonClick(){

    }

    handleChange(event){
        event.persist();
        console.log(event.target.id);
    }

    render() {
        return (
            <div className='Layout'>
                <header className='Header'>
                    Online Stratego
            </header>

                <Form className='Form' style={{ 'background-color': 'rgba(235,200,70,0.9)' }}>
                    <Form.Group>
                        <Form.Label>Username</Form.Label>
                        <Form.Control className='input' type='text' id='username' onChange={this.handleChange} />
                    </Form.Group>

                    <Form.Group>
                        <Form.Label>Password</Form.Label>
                        <Form.Control className='input' type='password' onChange={this.handleChange} />
                    </Form.Group>
                    <Form.Group>
                        <Form.Control className='input' type='password' onChange={this.handleChange}/>
                    </Form.Group>

                    <div className="btnLogin">
                        <Button onClick={this.handleButtonClick} className="btn btn-default">
                            <div className="txtLogin">
                                Log In
                            </div>
                        </Button>
                    </div>
                </Form>
            </div >

        )
    }
}
export default Login;
